import React from 'react'
import {Link} from "react-router-dom";



class Home extends React.Component {
  render() {
    return(

        <div>
          <ul>
            <li>
              <Link to="/">Home1</Link>
            </li>
            <li>
              <Link to="/about">About1</Link>
            </li>
            <li>
              <Link to="/topic">Topic1</Link>
            </li>
          </ul>
          <hr/>
          {this.props.children}
        </div>
    )
  }

}

export default Home
